import Logo from "../assets/logo.png"

export const Header = () => {
  return (
    <header>
      <div className="logo">
        <img src={Logo} alt="" />
        <span>Taskmate</span>
      </div>

      <div className="themeSelector"></div>
    </header>
  );
}
